           content:
            '–ë—ç–ª–≥–∏–π–Ω –±–æ–π–∂–∏–ª—Ç –≥—ç–¥—ç–≥ –Ω—å —á–∏–Ω–∏–π –±–∏–µ –º–∞—Ö–±–æ–¥ —Ö“Ø“Ø—Ö–¥—ç—ç—Å –Ω–∞—Å –±–∏–µ –≥“Ø–π—Ü—Å—ç–Ω —Ö“Ø–Ω–∏–π –±–∏–µ –±—è–ª–¥–∞—Ä—Ç —à–∏–ª–∂–∏–Ω ”©”©—Ä—á–ª”©–≥–¥”©—Ö “Ø–µ —é–º. –°—ç—Ç–≥—ç–ª —Ö”©–¥–ª”©–ª –±–æ–ª–æ–Ω –Ω–∏–π–≥—ç–º—à–ª–∏–π–Ω —Ö—É–≤—å–¥ ”©—Å”©–Ω —Ö”©–≥–∂–∏–∂ —ç—Ö—ç–ª–Ω—ç. –ë—ç–ª–≥–∏–π–Ω –±–æ–π–∂–∏–ª—Ç—ã–Ω “Ø–µ–¥ –±—ç–ª–≥–∏–π–Ω —Ö”©–≥–∂–∏–ª –∏–¥—ç–≤—Ö—Ç—ç–π —è–≤–∞–≥–¥–∞–∂, –±—ç–ª–≥–∏–π–Ω —Ö–∞—Ä—å—Ü–∞–∞–Ω–¥ –æ—Ä—Å–æ–Ω —Ç–æ—Ö–∏–æ–ª–¥–æ–ª–¥ (—Ö—ç—Ä—ç–≤ —Ç–∞ –æ—Ö–∏–Ω –±–æ–ª) –∂–∏—Ä—ç–º—Å–ª—ç—Ö —á–∞–¥–≤–∞—Ä—Ç–∞–π –±–æ–ª–æ—Ö –±–∞ (—Ö—ç—Ä—ç–≤ —Ç–∞ —ç—Ä—ç–≥—Ç—ç–π –±–æ–ª) –∂–∏—Ä—ç–º—Å–ª“Ø“Ø–ª—ç—Ö —á–∞–¥–≤–∞—Ä—Ç–∞–π –±–æ–ª–Ω–æ.',
