           content:
            '–ò—Ö—ç–Ω—Ö –æ—Ö–∏–¥—ã–Ω –±—ç–ª–≥–∏–π–Ω –±–æ–π–∂–∏–ª—Ç 9-13 –Ω–∞—Å–∞–Ω–¥ —ç—Ö—ç–ª–¥—ç–≥ –±–æ–ª–æ–≤—á –∑–∞—Ä–∏–º “Ø–µ–¥ “Ø“Ø–Ω—ç—ç—Å –∞—Ä–∞–π —ç—Ä—Ç —ç—Å–≤—ç–ª –∞—Ä–∞–π –æ—Ä–æ–π —ç—Ö—ç–ª–∂ –±–æ–ª–Ω–æ. –•“Ø–Ω –±“Ø—Ä –±—ç–ª–≥–∏–π–Ω –±–æ–π–∂–∏–ª—Ç—ã–Ω “Ø–µ–∏–π–≥ –¥–∞–º–∂–¥–∞–≥ —á —Ö“Ø–Ω –±“Ø—Ä—Ç —è–≤—Ü –Ω—å ”©”©—Ä ”©”©—Ä –±–∞–π–¥–∞–≥. –û—Ö–∏–¥—ã–Ω —Ö—É–≤—å–¥ —Ö–∞–º–≥–∏–π–Ω —Ç“Ø—Ä“Ø“Ø–Ω–¥ –∞–Ω–∑–∞–∞—Ä–∞–≥–¥–∞—Ö ”©”©—Ä—á–ª”©–ª—Ç –±–æ–ª —Ö”©—Ö —É—Ä–≥–∞—Ö –±–∞ —ç—Ö–Ω–∏–π “Ø–µ–¥ ”©—Ä”©”©—Å”©–Ω —Ç–∞–ª –Ω—å —Ç–æ–º—Ä–æ—Ö –Ω—å –æ–ª–æ–Ω—Ç–∞–∞ –∞–∂–∏–≥–ª–∞–≥–¥–¥–∞–≥. –•”©–≤–≥“Ø“Ø–¥–∏–π–Ω –±—ç–ª–≥–∏–π–Ω –±–æ–π–∂–∏–ª—Ç –æ—Ö–∏–¥—ã–Ω—Ö–æ–æ—Å –≥–∞–Ω—Ü —Ö–æ—ë—Ä –∂–∏–ª–∏–π–Ω –¥–∞—Ä–∞–∞, –∏—ç—Ö—ç–≤—á–ª—ç–Ω 10-14 –Ω–∞—Å–∞–Ω–¥ —ç—Ö—ç–ª–¥—ç–≥.',
