           content:
            '–ë—ç–ª–≥–∏–π–Ω –±–æ–π–∂–∏–ª—Ç—ã–Ω “Ø–µ–¥ —Ç–∞—Ä—Ö–∏ —á–∏–Ω—å –±–∏–µ–∏–π–Ω —è–Ω–∑ –±“Ø—Ä–∏–π–Ω —ç—Ä—Ö—Ç—ç–Ω–¥ –¥–∞–∞–≤–∞—Ä —è–ª–≥–∞—Ä—É—É–ª–∞—Ö –º–µ—Å—Å–µ–∂ –∏–ª–≥—ç—ç—Ö –±–∞ —ç–¥–≥—ç—ç—Ä –≥–æ—Ä–º–æ–Ω –Ω—å –±–∏–µ–∏–π–Ω ”©—Å”©–ª—Ç, —Ö”©–≥–∂–∏–ª—Ç”©–¥ –Ω”©–ª”©”©–ª–Ω”©. \n–ë–∏–µ –±—è–ª–¥—Ä—ã–Ω —Ö—É–≤—å–¥ –æ—Ö–∏–¥—ã–Ω ”©—Å”©–ª—Ç –¥–∞—Ä–∞–∞—Ö –¥–∞—Ä–∞–∞–ª–ª–∞–∞—Ä —è–≤–∞–≥–¥–¥–∞–≥: \n‚Ä¢ –•”©—Ö —Ç–æ–º–æ—Ä–Ω–æ, —ç—Ö–ª—ç—ç–¥ –≥–æ–ª—Ü—É—É –Ω—ç–≥ —Ç–∞–ª –Ω—å —Ç“Ø—Ä“Ø“Ø–ª–Ω—ç.  –≠–Ω—ç –Ω—å –æ–π—Ä–æ–ª—Ü–æ–æ–≥–æ–æ—Ä 2 –∂–∏–ª “Ø—Ä–≥—ç–ª–∂–∏–ª–¥—ç–≥.\n‚Ä¢ “Æ“Ø–Ω—ç—ç—Å —Ö—ç–¥—ç–Ω —Å–∞—Ä—ã–Ω –¥–∞—Ä–∞–∞–≥–∞–∞—Ä —É–º–¥–≥–∞–Ω –¥—ç—ç—Ä “Ø—Å —É—Ä–≥–∞–Ω–∞.  \n‚Ä¢ –£–º–∞–π–Ω —Ö–∞–Ω–∞ –∑—É–∑–∞–∞—Ä—á, —É–º–∞–π –±–æ–ª–æ–Ω ”©–Ω–¥–≥”©–≤—á —Ç–æ–º–æ—Ä–Ω–æ. \n‚Ä¢ –•”©—Ö —É—Ä–≥–∞–∂ —ç—Ö—ç–ª—Å–Ω—ç—ç—Å —Ö–æ–π—à 2-3 –∂–∏–ª–∏–π–Ω –¥–∞—Ä–∞–∞–≥–∞–∞—Ä —Å–∞—Ä—ã–Ω —Ç—ç–º–¥—ç–≥ –∏—Ä–∂ —ç—Ö—ç–ª–Ω—ç. –û—Ö–∏–¥—ã–Ω ”©–Ω–¥–≥”©–Ω —ç—Å —è–ª–≥–∞—Ä—á —ç—Ö—ç–ª—Å–Ω—ç—ç—Ä –æ—Ö–∏–¥ –∂–∏—Ä—ç–º—Å–ª—ç—Ö –±–æ–ª–æ–º–∂ –±“Ø—Ä–¥—ç–Ω—ç. “Æ—Ç—Ä—ç—ç–Ω–∏–π —à–∏–Ω–≥—ç–Ω –∏—Ö—ç—Å—á, —Å–∞—Ä—ã–Ω —Ç—ç–º–¥–≥–∏–π–Ω “Ø–µ–¥ ”©”©—Ä—á–ª”©–≥–¥”©–Ω”©.  \n‚Ä¢ –°—É–≥–∞–Ω–¥ “Ø—Å —É—Ä–≥–∞–∂, —Ö”©–ª—Å ”©”©—Ä—á–ª”©–≥–¥”©–∂ –∏–ª“Ø“Ø —Ö—É—Ä—Ü “Ø–Ω—ç—Ä—Ç—ç–π –±–æ–ª–Ω–æ  \n‚Ä¢ –û—Ö–∏–¥ ”©–Ω–¥”©—Ä –±–æ–ª–æ—Ö –±–∞ –∑–∞—Ä–∏–º “Ø–µ–¥ ”©—Å”©–ª—Ç –≥—ç–Ω—ç—Ç —è–≤–∞–≥–¥–∞–Ω–∞\n‚Ä¢ –ì—É—è –∑—É–∑–∞–∞—Ä—á, ”©”©—Ö”©–Ω –¥–∞–≤—Ö–∞—Ä–≥–∞ –Ω—ç–º—ç–≥–¥—ç–Ω—ç \n‚Ä¢ –î—É—É —Ö–æ–æ–ª–æ–π –∞—è–¥—É—É –∑”©”©–ª”©–Ω –±–æ–ª–Ω–æ\n‚Ä¢ –ê—Ä—å—Å –Ω—å —Ç–æ—Å–ª–æ–≥ –±–æ–ª–∂, –±–∞—Ç–≥–∞ –≥–∞—Ä–Ω–∞',
