            '”®—Å–≤”©—Ä –Ω–∞—Å –Ω—å –±–∏–µ –±—è–ª–¥–∞—Ä, —Å—ç—Ç–≥—ç–ª —Ö”©–¥–ª”©–ª –±–æ–ª–æ–Ω –Ω–∏–π–≥—ç–º—à–ª–∏–π–Ω —Ö—É–≤—å–¥ —Ö“Ø“Ø—Ö–¥—ç—ç—Å –±–∏–µ –≥“Ø–π—Ü—Å—ç–Ω —Ö“Ø–Ω –±–æ–ª–æ—Ö “Ø–µ –±—É—é—É 10-–∞–∞—Å 19 –Ω–∞—Å—ã–≥ —Ö—ç–ª–¥—ç–≥.\n–ó”©–≤—Ö”©–Ω –±–∏–µ –±—è–ª–¥—Ä—ã–Ω ”©”©—Ä—á–ª”©–ª—Ç –≥—ç–ª–≥“Ø–π, —Å—ç—Ç–≥—ç–ª —Ö”©–¥–ª”©–ª –±–æ–ª–æ–Ω –Ω–∏–π–≥–º–∏–π–Ω —Ö—É–≤—å–¥ —á –≥—ç—Å—ç–Ω —Ö”©–≥–∂–¥”©–≥.\n\n‚Ä¢ –°—ç—Ç–≥—ç–ª —Ö”©–¥–ª”©–ª–∏–π–Ω ”©”©—Ä—á–ª”©–ª—Ç –≥—ç–¥—ç–≥—Ç —Ö“Ø—á—Ç—ç–π –±”©–≥”©”©–¥ —Ç“Ø—Ä–≥—ç–Ω —Ö—É–≤—å—Å–∞—Ö —Å—ç—Ç–≥—ç–ª —Å–∞–Ω–∞–∞–Ω—ã –±–∞–π–¥–∞–ª, –±—ç–ª–≥–∏–π–Ω —Ö“Ø—Å—ç–ª, —Ç—ç–º“Ø“Ø–ª—ç–ª –∑—ç—Ä—ç–≥ –æ—Ä–Ω–æ.\n‚Ä¢ –ù–∏–π–≥—ç–º—à–ª–∏–π–Ω ”©”©—Ä—á–ª”©–ª—Ç”©–¥, –≥–∞–Ω—Ü–∞–∞—Ä–∞–∞ –±–∞–π—Ö —Ö“Ø—Å—ç–ª, —ç—Ü—ç–≥ —ç—Ö—ç—ç—Å –±–∏–µ –¥–∞–∞—Å–∞–Ω –±–∞–π–¥–∞–ª—Ç–∞–π –±–∞–π—Ö —ç—Ä–º—ç–ª–∑—ç–ª,  —Ü–∞–≥–∏–π–≥ “Ø–µ —Ç—ç–Ω–≥–∏–π–Ω –Ω”©—Ö”©–¥—Ç—ç–π–≥—ç—ç —Ö–∞–º—Ç ”©–Ω–≥”©—Ä“Ø“Ø–ª—ç—Ö–∏–π–≥ —Ö“Ø—Å—ç—Ö, –Ω”©—Ö”©—Ä–ª”©–ª–∏–π–≥ –∏–ª“Ø“Ø “Ø–Ω—ç–ª–¥—ç–≥ –±–æ–ª–æ—Ö, —Ö–∞–π—Ä —Å—ç—Ç–≥—ç–ª, —Ä–æ–º–∞–Ω—Ç–∏–∫ —Å—ç—Ç–≥—ç–ª–≥—ç—ç–≥ –∏–ª“Ø“Ø —Å–æ–Ω–∏—Ä—Ö–æ—Ö –∑—ç—Ä—ç–≥ –æ—Ä–Ω–æ!',
