           content:
            '–¢–∏–π–º—ç—ç, —Å–∞—Ä—ã–Ω —Ç—ç–º–¥–≥–∏–π–Ω “Ø–µ–¥ –±—ç–ª–≥–∏–π–Ω —Ö–∞–≤—å—Ç–∞–ª–¥ –æ—Ä–∂ –±–æ–ª–Ω–æ. –≠–Ω—ç –Ω—å —Ö–æ—Ä—Ç–æ–π –±–∏—à. –°–µ–∫—Å —Ö–∏–π—Ö –Ω—å –∑“Ø–π—Ç—ç–π —é—É, “Ø–≥“Ø–π —é—É –≥—ç–¥–≥–∏–π–≥ —Ç—É—Ö–∞–π–Ω —ç–º—ç–≥—Ç—ç–π, —Ç“Ø“Ø–Ω–∏–π —Ö–∞–º—Ç—Ä–∞–≥—á –Ω–∞—Ä –ª  —à–∏–π–¥—ç—Ö –∞—Å—É—É–¥–∞–ª. –ó–∞—Ä–∏–º —Ö“Ø–º“Ø“Ø—Å —ç–º—ç–≥—Ç—ç–π–Ω—Ö—ç—ç —Å–∞—Ä—ã–Ω —Ç—ç–º–¥–≥–∏–π–Ω “Ø–µ–¥ –±—ç–ª–≥–∏–π–Ω —Ö–∞—Ä—å—Ü–∞–∞–Ω–¥ –æ—Ä–æ—Ö—ã–≥ —Ç–∞–∞–≥“Ø–π –≥—ç–∂ “Ø–∑–¥—ç–≥. –£—á–∏—Ä –Ω—å —Ü—É—Å –≥–∞—Ä–∞—Ö—Ç–∞–π —Ö–æ–ª–±–æ–æ—Ç–æ–π —Ç”©–≤”©–≥—Ç—ç–π –∞—Å—É—É–¥–ª—É—É–¥ —Ç—É–ª–≥–∞—Ä–¥–∞–≥. –≠—ç–º—ç–≥—Ç—ç–π—á“Ø“Ø–¥ —Ö–∞–º—Ç—Ä–∞–≥—á—Ç–∞–π–≥–∞–∞ —è—Ä–∏–ª—Ü–∞–Ω ”©”©—Ä—Å–¥–∏–π–Ω —Ç–∞–∞–ª–ª–∞–∞—Ä —Å–æ–Ω–≥–æ–ª—Ç–æ–æ —Ö–∏–π—Ö —ç—Ä—Ö—Ç—ç–π. –•–∞—Ä–∏–Ω —Ö“Ø—Å—ç—ç–≥“Ø–π –∂–∏—Ä—ç–º—Å–ª—ç–ª—Ç, –±—ç–ª–≥–∏–π–Ω –∑–∞–º—ã–Ω —Ö–∞–ª–¥–≤–∞—Ä–∞–∞—Å —Å—ç—Ä–≥–∏–π–ª—ç—Ö–∏–π–Ω —Ç—É–ª–¥ –±–∞–π–Ω–≥–∞ –±—ç–ª–≥—ç–≤—á —Ö—ç—Ä—ç–≥–ª—ç—Ö —ë—Å—Ç–æ–π–≥–æ–æ —Å–∞–Ω–∞—Ö —Ö—ç—Ä—ç–≥—Ç—ç–π. –°–∞—Ä—ã–Ω —Ç—ç–º–¥–≥–∏–π–Ω “Ø–µ–¥ —Ö–∞–º–≥–∞–∞–ª–∞–ª—Ç–≥“Ø–π–≥—ç—ç—Ä –±—ç–ª–≥–∏–π–Ω —Ö–∞—Ä—å—Ü–∞–∞–Ω–¥ –æ—Ä–≤–æ–ª —Å–∞—Ä—ã–Ω —Ç—ç–º–¥–≥–∏–π–Ω –±–æ–≥–∏–Ω–æ –º”©—á–ª”©–≥—Ç—ç–π —Ö“Ø–Ω–¥ —ç—Å–≤—ç–ª —Ç—É—Ö–∞–π–Ω –º”©—á–ª”©–≥—Ç ”©–Ω–¥–≥”©–Ω —ç—Å —ç—Ä—Ç —è–ª–≥–∞—Ä–≤–∞–ª –∂–∏—Ä—ç–º—Å–ª—ç—Ö –±–æ–ª–æ–º–∂—Ç–æ–π.',
